Do your kids always ask for stories when they go to bed?

Are they bored of the same old story books you have at home? With Bedtime Stories Collection, you can find: 

- THREE FREE stories, "The Boy Who Cried Wolf", "Rapunzel" and "The Pied Piper of Hamelin", so you can enjoy the app with your kids;
- All the beloved characters: Sleeping Beauty, Three Little Pigs, Robin Hood, Rapunzel, Snow White, Gulliver, Pinocchio, Aladdin..;
- Dozens of Bedtime Stories to discover;
- Native narrators and original illustrations;
- Optional subtitles and narration;
- Autoplay or read it at your own pace.
 
The stories moral encourages children's thinking while teaching them about rightness, friendship and society behaviours. Little Red Riding Hood, the Sleeping Beauty, Rapunzel, the King Midas, Snow White, Pinocchio, Peter Pan, Aladdin, Sinbad, Gulliver, Ali Baba, Don Quixote, Robin Hood, Heidi and even Frankenstein... they're all here! 

If you have little kids at home then you can't miss having this story collection!
